import React from "react";
import {NavLink} from 'react-router-dom';

const Menu = () =>{

    return(
        <>
            <h1>portfolio website of<strong className="brand_name">ghani</strong></h1>
            <div className="menu-style">
            <NavLink exact activeClassName='active_class' to= '/home' >home</NavLink>
            <NavLink exact activeClassName='active_class' to= '/todolist'>Todolist</NavLink>
            <NavLink exact activeClassName='active_class' to='/acordion' >accordionproject</NavLink>
            <NavLink exact activeClassName='active_class' to= '/search' >search</NavLink>
            <NavLink exact activeClassName='active_class' to= '/user/ghani/vidya' >user</NavLink>
            </div>
        </>
    )
}

export default Menu;
